    "2016-04-19T02:28:08.418069",nt"name": "austin-fully-developed-floodplain",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains our current working
    understanding of where a "fully built-out" Austin's floodplains will be located
    based upon the best available data and modelling techniques.  Note that this information
    is used to guide the community in making safe decisions related to locating infrastructure
    outside of the floodplain but due to the complexity of these systems and the limitations
    of modelling, map accuracy and the relationship between the source data and the
    online basemap, these maps cannot serve as a functional replacement for consultations
    with City staff or trained professional engineers with local knowledge regarding
    flooding, hydrologic variability, modelling and the regulations related to development
    and health and human safety.",nt"license_title": "License Not Specified",nt"extras":
